import React from 'react';
import './Slider.scss';

function Slider() {

  let sliderArr = [1, 2, 3, 4, 5];

  return (
    <div className="Slider">
    <button className="ArrowBtn"><i className="arrow left"></i></button>
      {
        sliderArr.map((item, index) => {
          return(
            <div key={index} className= "Slide">
              {item}
            </div>
          )
        })
      }
    <button className="ArrowBtn"><i className="arrow right"></i></button>
    </div>
  );
}

export default Slider;

